		self.old_game.addEventListener("click",clickOld_game);
		
		//לחיצה על הקלפים
		self.poker.addEventListener("click",clickPoker);
		function clickPoker(){ self.gotoAndStop(2);
			self.black_halo.alpha = 0;}
		
		self.black.addEventListener("click",clickBlack);
		function clickBlack(){ self.gotoAndStop(4);
			self.poker_halo.alpha = 0;}
		
		self.jungle.addEventListener("click",clickJungle);
		function clickJungle(){ self.gotoAndStop(6);
			self.yaniv_halo.alpha = 0;
			self.taki_halo.alpha = 0;}
		
		self.bridge.addEventListener("click",clickBridge);
		function clickBridge(){ self.gotoAndStop(8);
				self.rummy_halo.alpha = 0;
		}
		
		self.yaniv.addEventListener("click",clickYaniv);
		function clickYaniv(){ self.gotoAndStop(10);
			self.jungle_halo.alpha = 0;
			self.taki_halo.alpha = 0;}
		
