		self.poker.addEventListener("mouseover", overPoker);
		self.poker.addEventListener("mouseout", outPoker);
		self.taki.addEventListener("mouseover", overTaki);
		self.taki.addEventListener("mouseout", outTaki);
		self.rummy.addEventListener("mouseover", overRummy);
		self.rummy.addEventListener("mouseout", outRummy);
		self.jungle.addEventListener("mouseover", overJungle);
		self.jungle.addEventListener("mouseout", outJungle);
		self.black.addEventListener("mouseover", overBlack);
		self.black.addEventListener("mouseout", outBlack);
		self.bridge.addEventListener("mouseover", overBridge);
		self.bridge.addEventListener("mouseout", outBridge);
